### Describe the bug

`messaging.operation` attribute is not set for Kafka Producer Spans. Messaging spec clearly states [here](https://github.com/open-telemetry/semantic-conventions/blob/main/docs/messaging/messaging-spans.md#messaging-attributes) that messaging.operation is required.

Currently document [here](https://github.com/open-telemetry/semantic-conventions/blob/main/docs/messaging/kafka.md) shows an example where `messaging.operation` is set for Kafka Consumer spans with `process` value - Which clearly follows Messaging spec [here](https://github.com/open-telemetry/semantic-conventions/blob/main/docs/messaging/messaging-spans.md#span-name) for `SpanName` that relies on this operation; but for Kafka Producer the messaging.operation is unset and unpopulated. However, Kafka Producer spans `SpanName` is set to `T1 publish`. 

Unable to understand currently why the messaging.operation is unset for Kafka Producer spans? Is it possible to bring messaging.operation to publish for Kafka Producer spans.

### Steps to reproduce

Use Kafka Client to publish a message to a Kafka queue - the producer span doesn’t have `messaging.operation` attribute set.

### Expected behavior

messaging.operation attribute should have been populated with publish value.

